import{_ as a}from"./profile-staff-roles-programs-f570c3bd.js";import{_ as r,a as t}from"./profile-student-photo-d0b8c0f6.js";import{_ as i,W as o,X as s,a0 as n}from"./framework-f89bf418.js";const l="/ihpme-vue-deploy/assets/profile-staff-roles-frontend-b2ec2949.jpg",e="/ihpme-vue-deploy/assets/profile-staff-roles-siderbar-6e55e129.png",d="/ihpme-vue-deploy/assets/profile-staff-roles-directory-d6063142.png",f="/ihpme-vue-deploy/assets/profile-staff-roles-editor-967a90fd.png",p="/ihpme-vue-deploy/assets/profile-staff-roles-name-d8444d54.png",h="/ihpme-vue-deploy/assets/profile-staff-roles-contact-person-606de7ae.png",A="/ihpme-vue-deploy/assets/profile-staff-roles-phone-43077b26.png",c="/ihpme-vue-deploy/assets/profile-staff-roles-email-address-db2aa533.png",m="data:image/png;base64,",g="/ihpme-vue-deploy/assets/profile-staff-roles-excerpt-e116948d.png",u="/ihpme-vue-deploy/assets/profile-staff-roles-departments-2d1ccf65.png",b="/ihpme-vue-deploy/assets/profile-staff-roles-positions-48de047c.png",w={},v=n('<h1 id="staff-roles" tabindex="-1"><a class="header-anchor" href="#staff-roles" aria-hidden="true">#</a> Staff Roles</h1><p>Staff Roles are stored within their own area of the WordPress editor. Profiles stored in the profile area can be accessed and drawn into other areas of the IHPME website. Staff Roles/Profiles have limited information stored within and do not contain full bios as other profiles do.</p><p><strong>Example of staff roles in use:</strong></p><p><img src="'+l+'" alt="Staff directory"></p><h2 id="accessing-staff-roles" tabindex="-1"><a class="header-anchor" href="#accessing-staff-roles" aria-hidden="true">#</a> Accessing Staff Roles</h2><p>To access the <code>Staff Roles</code> click or hover over the <code>Staff Roles</code> link on the left-hand side of the WordPress editor. Here you will be presented with a several options.</p><h3 id="staff-roles-editor-options" tabindex="-1"><a class="header-anchor" href="#staff-roles-editor-options" aria-hidden="true">#</a> Staff Roles editor options</h3><p>There are many options available within the <code>Staff Roles</code> menu, most of which are relegated to administrator access only. Staff and General Faculty members will only have &quot;Add New&quot; and &quot;All Faculty Profiles&quot; available to them.</p><h4 id="example-of-wordpress-sidebar" tabindex="-1"><a class="header-anchor" href="#example-of-wordpress-sidebar" aria-hidden="true">#</a> Example of WordPress sidebar:</h4><p><img src="'+e+'" alt="Staff Roles sidebar"></p><h4 id="all-staff-roles" tabindex="-1"><a class="header-anchor" href="#all-staff-roles" aria-hidden="true">#</a> All Staff Roles</h4><p>Provides a listing of all staff roles/profiles currently saved within the WordPress database.</p><h4 id="add-new" tabindex="-1"><a class="header-anchor" href="#add-new" aria-hidden="true">#</a> Add New</h4><p>Adds a new blank staff role profile to the database for editing.</p><h4 id="programs" tabindex="-1"><a class="header-anchor" href="#programs" aria-hidden="true">#</a> Programs</h4><p>Configures the listing of available programs within the WordPress database.</p><h4 id="departments" tabindex="-1"><a class="header-anchor" href="#departments" aria-hidden="true">#</a> Departments</h4><p>Configures the listing of available staffing departments within the WordPress database.</p><h4 id="program-order" tabindex="-1"><a class="header-anchor" href="#program-order" aria-hidden="true">#</a> Program Order</h4><p>Configurable order of all programs currently available within IHPME.</p><h4 id="department-order" tabindex="-1"><a class="header-anchor" href="#department-order" aria-hidden="true">#</a> Department Order</h4><p>Configures order of available departments listing.</p><h2 id="editing-creating-profiles" tabindex="-1"><a class="header-anchor" href="#editing-creating-profiles" aria-hidden="true">#</a> Editing &amp; Creating Profiles</h2><h3 id="adding-a-new-staff-role" tabindex="-1"><a class="header-anchor" href="#adding-a-new-staff-role" aria-hidden="true">#</a> Adding a new Staff Role</h3><p>To add a new staff role profile, select or hover over the <code>Staff Roles</code> menu item on the left-hand sidebar and click &quot;Add New&quot;.</p><p><img src="'+e+'" alt="Staff Roles sidebar"></p><h3 id="finding-a-profile" tabindex="-1"><a class="header-anchor" href="#finding-a-profile" aria-hidden="true">#</a> Finding a profile</h3><p>To find a profile within the WordPress editor, select &quot;All Staff Roles&quot; from the <code>Staff Roles</code> sidebar menu. This will display a listing of all available profiles in the WordPress editor.</p><p><strong>List view of all staff role profiles:</strong></p><p><img src="'+d+'" alt="Staff roles directory view"></p><p>From the list view of all profiles you can filter the available results by several methods:</p><ul><li><strong>Search Field:</strong> Search for a specific profile by name (upper right-hand corner).</li><li><strong>Dropdown filters:</strong> Provides several options to filter by date, program, departments, positons.</li><li><strong>By page:</strong> Allows jumping to a specific page or advancing forward/backwards within the listing of profiles.</li></ul><h3 id="viewing-a-profile" tabindex="-1"><a class="header-anchor" href="#viewing-a-profile" aria-hidden="true">#</a> Viewing a profile</h3><p>Below is an example of an existing <code>staff role</code> within the WordPress editor. Staff role profiles unlike other profiles are very limited in the amount of editable features. Staff role profiles do not have a full biography and feature set found in other profile types. All fields entered will be displayed in predefined formatting.</p><p><strong>Example of Staff roles editor:</strong></p><p><img src="'+f+'" alt="Staff Roles editor"></p><h3 id="editing-a-profile" tabindex="-1"><a class="header-anchor" href="#editing-a-profile" aria-hidden="true">#</a> Editing a profile</h3><h4 id="role-title" tabindex="-1"><a class="header-anchor" href="#role-title" aria-hidden="true">#</a> Role Title</h4><p>The title of the <code>staff role</code> can be edited by inputting a name into the first field available below the heading &quot;Edit Staff Role&quot;.</p><p><img src="'+p+'" alt="Editing staff role name"></p><h4 id="contact-name" tabindex="-1"><a class="header-anchor" href="#contact-name" aria-hidden="true">#</a> Contact Name</h4><p>The contact associated with the <code>staff role</code> can be input into the contact name field. Multiple people can be assigned to the same role by creating new profiles.</p><p><img src="'+h+'" alt="Contact name staff role"></p><h4 id="phone-number" tabindex="-1"><a class="header-anchor" href="#phone-number" aria-hidden="true">#</a> Phone Number</h4><p>Insert a phone number here to add an associated phone number to the current staff role profile.</p><p><img src="'+A+'" alt="Phone number"></p><h4 id="email-address" tabindex="-1"><a class="header-anchor" href="#email-address" aria-hidden="true">#</a> Email Address</h4><p>Input the staff profiles associated email address here.</p><p><img src="'+c+'" alt="Staff email address"></p><h4 id="profile-url" tabindex="-1"><a class="header-anchor" href="#profile-url" aria-hidden="true">#</a> Profile URL</h4><p>IF the staff profile has an external URL for their profile it can be input here.</p><p><img src="'+m+'" alt="Profile URL"></p><h4 id="excerpt" tabindex="-1"><a class="header-anchor" href="#excerpt" aria-hidden="true">#</a> Excerpt</h4><p>Useful summary area for staff role, optional usage.</p><p><img src="'+g+'" alt="Staff role excerpt"></p><h4 id="programs-1" tabindex="-1"><a class="header-anchor" href="#programs-1" aria-hidden="true">#</a> Programs</h4><p>If applicable you can select the associated program(s) the current staff role profile is associated with.</p><p><img src="'+a+'" alt="Staff role programs"></p><h4 id="departments-1" tabindex="-1"><a class="header-anchor" href="#departments-1" aria-hidden="true">#</a> Departments</h4><p>Configures the associated department within IHPME the staff role profile is associated with.</p><p><img src="'+u+'" alt="Staff role departments"></p><h4 id="positions" tabindex="-1"><a class="header-anchor" href="#positions" aria-hidden="true">#</a> Positions</h4><p>Configures the staff role position within IHPME, can be inputted as multiple positions.</p><p><img src="'+b+'" alt="Positions configuration"></p><h3 id="profile-photo" tabindex="-1"><a class="header-anchor" href="#profile-photo" aria-hidden="true">#</a> Profile Photo</h3><p>To change the profile photo either replace either hit the &quot;set feature image&quot; button if no photo is currently placed or &quot;replace image&quot; if a photo is currently associated with the profile.</p><p><img src="'+r+'" alt="Profile Photo no image set"></p><p><img src="'+t+'" alt="Profile Photo"></p><p>After selecting an image, you can adjust the focal point of the image with the &quot;focal point picker&quot; tool. This allows fine control over the position of the image within the cropped area.</p>',69),Q=[v];function C(E,P){return o(),s("div",null,Q)}const x=i(w,[["render",C],["__file","staff-roles.html.vue"]]);export{x as default};
